     def perform_task(self, task):
         """Auto-generated method to perform a task."""
         task_type = task.get('type')
         if task_type == 'python':
             return self.tool_server.python_notebook.execute_code(task.get('content'))
         elif task_type == 'shell':
             return self.tool_server.shell.execute(task.get('content'))
         else:
             raise ValueError(f"Unknown task type: {task_type}")
